import { FaShoppingCart } from "react-icons/fa";
import {NavLink} from "react-router-dom"
const Navbar = () => {
  return (
    <div>
        <div className="flex justify-between">
          <NavLink to="/">
            <img src=""></img>
          </NavLink>
          <div>
            <p>Home</p>
            <NavLink to="/cart">
              <FaShoppingCart />
            </NavLink>
          </div>
        </div>
    </div>
  )
};

export default Navbar;
